import{_ as e,c as r,o as a,d as t}from"./app.e0e4ea3a.js";const f=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[{"level":2,"title":"title: \u674E\u5175-\u6D4F\u89C8\u5668\u5DE5\u4F5C\u539F\u7406\u4E0E\u5B9E\u8DF5","slug":"title-\u674E\u5175-\u6D4F\u89C8\u5668\u5DE5\u4F5C\u539F\u7406\u4E0E\u5B9E\u8DF5","link":"#title-\u674E\u5175-\u6D4F\u89C8\u5668\u5DE5\u4F5C\u539F\u7406\u4E0E\u5B9E\u8DF5","children":[]},{"level":2,"title":"\u914D\u7F6EPerformance","slug":"\u914D\u7F6Eperformance","link":"#\u914D\u7F6Eperformance","children":[]},{"level":2,"title":"\u8BA4\u8BC6\u62A5\u544A\u9875","slug":"\u8BA4\u8BC6\u62A5\u544A\u9875","link":"#\u8BA4\u8BC6\u62A5\u544A\u9875","children":[]},{"level":2,"title":"\u603B\u7ED3","slug":"\u603B\u7ED3","link":"#\u603B\u7ED3","children":[]},{"level":2,"title":"\u601D\u8003\u9898","slug":"\u601D\u8003\u9898","link":"#\u601D\u8003\u9898","children":[]}],"relativePath":"JavaScript/\u674E\u5175-\u6D4F\u89C8\u5668\u5DE5\u4F5C\u539F\u7406\u4E0E\u5B9E\u8DF5/\u52A0\u9910\u56DB\uFF5C\u9875\u9762\u6027\u80FD\u5DE5\u5177-\u5982\u4F55\u4F7F\u7528Performance.md"}'),n={name:"JavaScript/\u674E\u5175-\u6D4F\u89C8\u5668\u5DE5\u4F5C\u539F\u7406\u4E0E\u5B9E\u8DF5/\u52A0\u9910\u56DB\uFF5C\u9875\u9762\u6027\u80FD\u5DE5\u5177-\u5982\u4F55\u4F7F\u7528Performance.md"},o=t('<hr><h2 id="title-\u674E\u5175-\u6D4F\u89C8\u5668\u5DE5\u4F5C\u539F\u7406\u4E0E\u5B9E\u8DF5" tabindex="-1">title: \u674E\u5175-\u6D4F\u89C8\u5668\u5DE5\u4F5C\u539F\u7406\u4E0E\u5B9E\u8DF5 <a class="header-anchor" href="#title-\u674E\u5175-\u6D4F\u89C8\u5668\u5DE5\u4F5C\u539F\u7406\u4E0E\u5B9E\u8DF5" aria-hidden="true">#</a></h2><p>\u52A0\u9910\u56DB\uFF5C\u9875\u9762\u6027\u80FD\u5DE5\u5177\uFF1A\u5982\u4F55\u4F7F\u7528Performance\uFF1F</p><p>\u4F60\u597D\uFF0C\u6211\u662F\u674E\u5175\u3002</p><p>\u5728\u5206\u6790\u9875\u9762\u6027\u80FD\u65F6\uFF0C\u5982\u679C\u8BF4Audits\u662F\u9053\u5F00\u80C3\u83DC\uFF0C\u90A3\u4E48Performance\u624D\u662F\u6B63\u9910\uFF0C\u4E4B\u6240\u8FD9\u6837\u8BF4\uFF0C\u4E3B\u8981\u662F\u56E0\u4E3APerformance\u53EF\u4EE5\u8BB0\u5F55\u7AD9\u70B9\u5728\u8FD0\u884C\u8FC7\u7A0B\u4E2D\u7684\u6027\u80FD\u6570\u636E\uFF0C\u6709\u4E86\u8FD9\u4E9B\u6027\u80FD\u6570\u636E\uFF0C\u6211\u4EEC\u5C31\u53EF\u4EE5\u56DE\u653E\u6574\u4E2A\u9875\u9762\u7684\u6267\u884C\u8FC7\u7A0B\uFF0C\u8FD9\u6837\u5C31\u65B9\u4FBF\u6211\u4EEC\u6765\u5B9A\u4F4D\u548C\u8BCA\u65AD\u6BCF\u4E2A\u65F6\u95F4\u6BB5\u5185\u9875\u9762\u7684\u8FD0\u884C\u60C5\u51B5\uFF0C\u4ECE\u800C\u6709\u6548\u5E2E\u52A9\u6211\u4EEC\u627E\u51FA\u9875\u9762\u7684\u6027\u80FD\u74F6\u9888\u3002</p><p>\u4E0D\u540C\u4E8EAudits\uFF0CPerofrmance\u4E0D\u4F1A\u7ED9\u51FA\u6027\u80FD\u5F97\u5206\uFF0C\u4E5F\u4E0D\u4F1A\u7ED9\u51FA\u4F18\u5316\u5EFA\u8BAE\uFF0C\u5B83\u53EA\u662F\u5355\u7EAF\u5730\u91C7\u96C6\u6027\u80FD\u6570\u636E\uFF0C\u5E76\u5C06\u91C7\u96C6\u5230\u7684\u6570\u636E\u6309\u7167\u65F6\u95F4\u7EBF\u7684\u65B9\u5F0F\u6765\u5C55\u73B0\uFF0C\u6211\u4EEC\u8981\u505A\u7684\u5C31\u662F\u4F9D\u636E\u539F\u59CB\u6570\u636E\u6765\u5206\u6790Web\u5E94\u7528\u7684\u6027\u80FD\u95EE\u9898\u3002</p><p>\u90A3\u4E48\u672C\u8282\uFF0C\u6211\u4EEC\u5C31\u7EE7\u7EED\u6DF1\u5165\uFF0C\u804A\u804A\u5982\u4F55\u4F7F\u7528Performance\u3002\u901A\u5E38\uFF0C\u4F7F\u7528Performance\u9700\u8981\u5206\u4E09\u6B65\u8D70\uFF1A</p><ol><li>\u7B2C\u4E00\u6B65\u662F\u914D\u7F6EPerformance\uFF1B</li><li>\u7B2C\u4E8C\u6B65\u662F\u751F\u6210\u62A5\u544A\u9875\uFF1B</li><li>\u7B2C\u4E09\u6B65\u5C31\u662F\u4EBA\u5DE5\u5206\u6790\u62A5\u544A\u9875\uFF0C\u5E76\u627E\u51FA\u9875\u9762\u7684\u6027\u80FD\u74F6\u9888\u3002</li></ol><p>\u63A5\u4E0B\u6765\uFF0C\u6211\u4F1A\u6839\u636E\u4E0A\u9762\u8FD9\u4E09\u4E2A\u6B65\u9AA4\u5E26\u4F60\u719F\u6089Performace\uFF0C\u5E76\u8BA9\u4F60\u4E86\u89E3\u5982\u4F55\u4F7F\u7528Performance\u6765\u5206\u6790\u9875\u9762\u6027\u80FD\u6570\u636E\u3002</p><h2 id="\u914D\u7F6Eperformance" tabindex="-1">\u914D\u7F6EPerformance <a class="header-anchor" href="#\u914D\u7F6Eperformance" aria-hidden="true">#</a></h2><p>\u6211\u4EEC\u5728Chrome\u4E2D\u4EFB\u610F\u6253\u5F00\u4E00\u4E2A\u7AD9\u70B9\uFF0C\u518D\u6253\u5F00Chrome\u5F00\u53D1\u8005\u5DE5\u5177\uFF0C\u7136\u540E\u9009\u62E9Performance\u6807\u7B7E\uFF0C\u6700\u7EC8\u6548\u679C\u5982\u4E0B\u56FE\u6240\u793A\uFF1A</p><p><img src="https://static001.geekbang.org/resource/image/03/1c/036585de056964e025b9ed2ecd2bde1c.png" alt=""></p><p>Performance\u914D\u7F6E\u9875</p><p>\u4E0A\u56FE\u5C31\u662FPerformance\u7684\u914D\u7F6E\u9875\uFF0C\u89C2\u5BDF\u56FE\u4E2D\u533A\u57DF1\uFF0C\u6211\u4EEC\u53EF\u4EE5\u8BBE\u7F6E\u8BE5\u533A\u57DF\u4E2D\u7684\u201CNetwork\u201D\u6765\u9650\u5236\u7F51\u7EDC\u52A0\u8F7D\u901F\u5EA6\uFF0C\u8BBE\u7F6E\u201CCPU\u201D\u6765\u9650\u5236CPU\u7684\u8FD0\u7B97\u901F\u5EA6\u3002\u901A\u8FC7\u8BBE\u7F6E\uFF0C\u6211\u4EEC\u5C31\u53EF\u4EE5\u5728Chrome\u6D4F\u89C8\u5668\u4E0A\u6765\u6A21\u62DF\u624B\u673A\u7B49\u6027\u80FD\u4E0D\u9AD8\u7684\u8BBE\u5907\u4E86\u3002\u5728\u8FD9\u91CC\u6211\u5C06CPU\u7684\u8FD0\u7B97\u80FD\u529B\u964D\u4F4E\u5230\u4E86<strong>1/6</strong>\uFF0C\u5C06\u7F51\u7EDC\u7684\u52A0\u8F7D\u901F\u5EA6\u8BBE\u7F6E\u4E3A\u201C<strong>\u5FEB\u76843G(Fast 3G)</strong>\u201D\u7528\u6765\u6A21\u62DF3G\u7684\u7F51\u7EDC\u72B6\u6001\u3002</p><p>\u4E0D\u540C\u4E8EAudits\u53EA\u80FD\u76D1\u63A7\u52A0\u8F7D\u9636\u6BB5\u7684\u6027\u80FD\u6570\u636E\uFF0CPerformance\u8FD8\u53EF\u4EE5\u76D1\u63A7\u4EA4\u4E92\u9636\u6BB5\u7684\u6027\u80FD\u6570\u636E\uFF0C\u4E0D\u8FC7Performance\u662F\u5206\u522B\u5F55\u5236\u8FD9\u4E24\u4E2A\u9636\u6BB5\u7684\uFF0C\u4F60\u53EF\u4EE5\u67E5\u770B\u4E0A\u56FE\u533A\u57DF2\u548C\u533A\u57DF3\uFF0C\u6211\u4EEC\u53EF\u4EE5\u770B\u5230\u8FD9\u91CC\u6709\u4E24\u4E2A\u6309\u94AE\uFF0C\u4E0A\u9762\u90A3\u4E2A\u9ED1\u8272\u6309\u94AE\u662F\u7528\u6765\u8BB0\u5F55\u4EA4\u4E92\u9636\u6BB5\u6027\u80FD\u6570\u636E\u7684\uFF0C\u4E0B\u9762\u90A3\u4E2A\u5E26\u7BAD\u5934\u7684\u5706\u5708\u5F62\u6309\u94AE\u7528\u6765\u8BB0\u5F55\u52A0\u8F7D\u9636\u6BB5\u7684\u6027\u80FD\u6570\u636E\u3002</p><p>\u53E6\u5916\u4F60\u8FD8\u8981\u6CE8\u610F\u4E00\u70B9\uFF0C\u8FD9\u4E24\u79CD\u5F55\u5236\u65B9\u5F0F\u7A0D\u5FAE\u6709\u70B9\u4E0D\u540C\uFF1A</p><ul><li>\u5F53\u4F60<strong>\u5F55\u5236\u52A0\u8F7D</strong>\u9636\u6BB5\u7684\u6027\u80FD\u6570\u636E\u65F6\uFF0CPerformance\u4F1A\u91CD\u65B0\u5237\u65B0\u9875\u9762\uFF0C\u5E76\u7B49\u5230\u9875\u9762\u5B8C\u5168\u6E32\u67D3\u51FA\u6765\u540E\uFF0CPerformance\u5C31\u4F1A\u81EA\u52A8\u505C\u6B62\u5F55\u5236\u3002</li><li>\u5982\u679C\u4F60\u662F<strong>\u5F55\u5236\u4EA4\u4E92\u9636\u6BB5</strong>\u7684\u6027\u80FD\u65F6\uFF0C\u90A3\u4E48\u9700\u8981\u624B\u52A8\u505C\u6B62\u5F55\u5236\u8FC7\u7A0B\u3002</li></ul><h2 id="\u8BA4\u8BC6\u62A5\u544A\u9875" tabindex="-1">\u8BA4\u8BC6\u62A5\u544A\u9875 <a class="header-anchor" href="#\u8BA4\u8BC6\u62A5\u544A\u9875" aria-hidden="true">#</a></h2><p>\u65E0\u8BBA\u91C7\u7528\u54EA\u79CD\u65B9\u5F0F\u5F55\u5236\uFF0C\u6700\u7EC8\u6240\u751F\u6210\u7684\u62A5\u544A\u9875\u90FD\u662F\u4E00\u6837\u7684\uFF0C\u5982\u4E0B\u56FE\u6240\u793A\uFF1A</p><p><img src="https://static001.geekbang.org/resource/image/89/e3/89164eac8a512e7a677e6e7bc88068e3.png" alt=""></p><p>Performance\u7684\u62A5\u544A\u9875</p><p>\u89C2\u5BDF\u4E0A\u56FE\u7684\u62A5\u544A\u9875\uFF0C\u6211\u4EEC\u53EF\u4EE5\u5C06\u5B83\u5206\u4E3A\u4E09\u4E2A\u4E3B\u8981\u7684\u90E8\u5206\uFF0C\u5206\u522B\u4E3A<strong>\u6982\u89C8\u9762\u677F\u3001\u6027\u80FD\u6307\u6807\u9762\u677F\u548C\u8BE6\u60C5\u9762\u677F</strong>\u3002</p><p>\u8981\u719F\u7EC3\u638C\u63E1\u8FD9\u4E09\u4E2A\u9762\u677F\uFF0C\u6211\u4EEC\u9700\u8981\u5148\u660E\u767D\u65F6\u95F4\u7EBF\u7684\u6982\u5FF5\uFF0C\u8FD9\u662F\u56E0\u4E3A\u6982\u89C8\u9762\u677F\u548C\u6027\u80FD\u6307\u6807\u9762\u677F\u90FD\u4F9D\u8D56\u4E8E\u65F6\u95F4\u7EBF\u3002\u6211\u4EEC\u77E5\u9053\uFF0CPerformance\u6309\u7167\u65F6\u95F4\u7684\u987A\u5E8F\u6765\u8BB0\u5F55\u6BCF\u4E2A\u65F6\u95F4\u8282\u70B9\u7684\u6027\u80FD\u6570\u636E\uFF0C\u7136\u540E\u518D\u6309\u7167\u65F6\u95F4\u987A\u5E8F\u6765\u5C55\u793A\u8FD9\u4E9B\u6027\u80FD\u6570\u636E\uFF0C\u90A3\u4E48\u5C55\u793A\u7684\u65F6\u5019\u5C31\u5FC5\u7136\u8981\u5F15\u5165\u65F6\u95F4\u7EBF\u4E86\u3002\u6BD4\u5982\u4E0A\u56FE\u4E2D\u6211\u4EEC\u5F55\u5236\u4E8610000\u6BEB\u79D2\uFF0C\u90A3\u4E48\u5B83\u7684\u65F6\u95F4\u7EBF\u957F\u5EA6\u4E5F\u5C31\u662F10000\u6BEB\u79D2\uFF0C\u4F53\u73B0\u5728\u4E0A\u56FE\u4E2D\u5C31\u662F\u6982\u89C8\u9762\u677F\u6700\u4E0A\u9762\u90A3\u6761\u7EBF\u3002</p><h4 id="_1-\u6982\u89C8\u9762\u677F" tabindex="-1">1. \u6982\u89C8\u9762\u677F <a class="header-anchor" href="#_1-\u6982\u89C8\u9762\u677F" aria-hidden="true">#</a></h4><p>\u597D\u4E86\uFF0C\u5F15\u5165\u4E86\u65F6\u95F4\u7EBF\uFF0C<strong>Performance\u5C31\u4F1A\u5C06\u51E0\u4E2A\u5173\u952E\u6307\u6807\uFF0C\u8BF8\u5982\u9875\u9762\u5E27\u901F(FPS)\u3001CPU\u8D44\u6E90\u6D88\u8017\u3001\u7F51\u7EDC\u8BF7\u6C42\u6D41\u91CF\u3001V8\u5185\u5B58\u4F7F\u7528\u91CF(\u5806\u5185\u5B58)\u7B49\uFF0C\u6309\u7167\u65F6\u95F4\u987A\u5E8F\u505A\u6210\u56FE\u8868\u7684\u5F62\u5F0F\u5C55\u73B0\u51FA\u6765\uFF0C\u8FD9\u5C31\u662F\u6982\u89C8\u9762\u677F</strong>\uFF0C\u4F60\u53EF\u4EE5\u53C2\u770B\u4E0A\u56FE\u3002</p><p>\u6709\u4E86\u6982\u89C8\u9762\u677F\uFF0C\u6211\u4EEC\u5C31\u80FD\u4E00\u89C8\u51E0\u4E2A\u5173\u952E\u7684\u5386\u53F2\u6570\u636E\u6307\u6807\uFF0C\u8FDB\u800C\u80FD\u5FEB\u901F\u5B9A\u4F4D\u5230\u53EF\u80FD\u5B58\u5728\u95EE\u9898\u7684\u65F6\u95F4\u8282\u70B9\u3002\u90A3\u4E48\u5982\u4F55\u5B9A\u4F4D\u53EF\u80FD\u5B58\u5728\u95EE\u9898\u7684\u65F6\u95F4\u8282\u70B9\u5462\uFF1F</p><ul><li>\u5982\u679CFPS\u56FE\u8868\u4E0A\u51FA\u73B0\u4E86\u7EA2\u8272\u5757\uFF0C\u90A3\u4E48\u5C31\u8868\u793A\u7EA2\u8272\u5757\u9644\u8FD1\u6E32\u67D3\u51FA\u4E00\u5E27\u6240\u9700\u65F6\u95F4\u8FC7\u4E45\uFF0C\u5E27\u7684\u6E32\u67D3\u65F6\u95F4\u8FC7\u4E45\uFF0C\u5C31\u6709\u53EF\u80FD\u5BFC\u81F4\u9875\u9762\u5361\u987F\u3002</li><li>\u5982\u679CCPU\u56FE\u5F62\u5360\u7528\u9762\u79EF\u592A\u5927\uFF0C\u8868\u793ACPU\u4F7F\u7528\u7387\u5C31\u8D8A\u9AD8\uFF0C\u90A3\u4E48\u5C31\u6709\u53EF\u80FD\u56E0\u4E3A\u67D0\u4E2AJavaScript\u5360\u7528\u592A\u591A\u7684\u4E3B\u7EBF\u7A0B\u65F6\u95F4\uFF0C\u4ECE\u800C\u5F71\u54CD\u5176\u4ED6\u4EFB\u52A1\u7684\u6267\u884C\u3002</li><li>\u5982\u679CV8\u7684\u5185\u5B58\u4F7F\u7528\u91CF\u4E00\u76F4\u5728\u589E\u52A0\uFF0C\u5C31\u6709\u53EF\u80FD\u662F\u67D0\u79CD\u539F\u56E0\u5BFC\u81F4\u4E86\u5185\u5B58\u6CC4\u6F0F\u3002</li></ul><p>\u9664\u4E86\u4EE5\u4E0A\u6307\u6807\u4EE5\u5916\uFF0C\u6982\u89C8\u9762\u677F\u8FD8\u5C55\u793A\u52A0\u8F7D\u8FC7\u7A0B\u4E2D\u7684\u51E0\u4E2A\u5173\u952E\u65F6\u95F4\u8282\u70B9\uFF0C\u5982FP\u3001LCP\u3001DOMContentLoaded\u3001Onload\u7B49\u4E8B\u4EF6\u4EA7\u751F\u7684\u65F6\u95F4\u70B9\u3002\u8FD9\u4E9B\u5173\u952E\u65F6\u95F4\u70B9\u4F53\u73B0\u5728\u4E86\u51E0\u6761\u4E0D\u540C\u989C\u8272\u7684\u7AD6\u7EBF\u4E0A\u3002</p><h4 id="_2-\u6027\u80FD\u9762\u677F" tabindex="-1">2. \u6027\u80FD\u9762\u677F <a class="header-anchor" href="#_2-\u6027\u80FD\u9762\u677F" aria-hidden="true">#</a></h4><p>\u901A\u5E38\uFF0C\u6211\u4EEC\u901A\u8FC7\u6982\u89C8\u9762\u677F\u6765\u5B9A\u4F4D\u5230\u53EF\u80FD\u5B58\u5728\u95EE\u9898\u7684\u65F6\u95F4\u8282\u70B9\uFF0C\u63A5\u4E0B\u6765\u9700\u8981\u66F4\u8FDB\u4E00\u6B65\u7684\u6570\u636E\uFF0C\u6765\u5206\u6790\u5BFC\u81F4\u8BE5\u95EE\u9898\u7684\u539F\u56E0\uFF0C\u90A3\u4E48\u5E94\u8BE5\u600E\u4E48\u5206\u6790\u5462\uFF1F</p><p>\u8FD9\u5C31\u9700\u8981\u5F15\u5165<strong>\u6027\u80FD\u9762\u677F</strong>\u4E86\uFF0C\u5728\u6027\u80FD\u9762\u677F\u4E2D\uFF0C\u8BB0\u5F55\u4E86\u975E\u5E38\u591A\u7684\u6027\u80FD\u6307\u6807\u9879\uFF0C\u6BD4\u5982<strong>Main</strong>\u6307\u6807\u8BB0\u5F55\u6E32\u67D3\u4E3B\u7EBF\u7A0B\u7684\u4EFB\u52A1\u6267\u884C\u8FC7\u7A0B\uFF0C<strong>Compositor\u6307\u6807</strong>\u8BB0\u5F55\u4E86\u5408\u6210\u7EBF\u7A0B\u7684\u4EFB\u52A1\u6267\u884C\u8FC7\u7A0B\uFF0C<strong>GPU\u6307\u6807</strong>\u8BB0\u5F55\u4E86GPU\u8FDB\u7A0B\u4E3B\u7EBF\u7A0B\u7684\u4EFB\u52A1\u6267\u884C\u8FC7\u7A0B\u3002\u6709\u4E86\u8FD9\u4E9B\u8BE6\u7EC6\u7684\u6027\u80FD\u6570\u636E\uFF0C\u5C31\u53EF\u4EE5\u5E2E\u52A9\u6211\u4EEC\u8F7B\u677E\u5730\u5B9A\u4F4D\u5230\u9875\u9762\u7684\u6027\u80FD\u95EE\u9898\u3002</p><p>\u7B80\u800C\u8A00\u4E4B\uFF0C<strong>\u6211\u4EEC\u901A\u8FC7\u6982\u89C8\u9762\u677F\u6765\u5B9A\u4F4D\u95EE\u9898\u7684\u65F6\u95F4\u8282\u70B9\uFF0C\u7136\u540E\u518D\u4F7F\u7528\u6027\u80FD\u9762\u677F\u5206\u6790\u8BE5\u65F6\u95F4\u8282\u70B9\u5185\u7684\u6027\u80FD\u6570\u636E</strong>\u3002\u5177\u4F53\u5730\u8BB2\uFF0C\u6BD4\u5982\u6982\u89C8\u9762\u677F\u4E2D\u7684FPS\u56FE\u8868\u4E2D\u51FA\u73B0\u4E86\u7EA2\u8272\u5757\uFF0C\u90A3\u4E48\u6211\u4EEC\u70B9\u51FB\u8BE5\u7EA2\u8272\u5757\uFF0C\u6027\u80FD\u9762\u677F\u5C31\u5B9A\u4F4D\u5230\u8BE5\u7EA2\u8272\u5757\u7684\u65F6\u95F4\u8282\u70B9\u5185\u4E86\uFF0C\u4F60\u53EF\u4EE5\u53C2\u8003\u4E0B\u56FE\uFF1A</p><p><img src="https://static001.geekbang.org/resource/image/8f/d5/8f029c84fb7606360a83c4a1f01627d5.png" alt=""></p><p>\u9009\u62E9\u65F6\u95F4\u7EBF\u4E0A\u7684\u4E00\u6BB5</p><p>\u89C2\u5BDF\u4E0A\u56FE\uFF0C\u6211\u4EEC\u53D1\u73B0\u6027\u80FD\u9762\u677F\u7684\u6700\u4E0A\u65B9\u4E5F\u6709\u4E00\u6BB5\u65F6\u95F4\u7EBF\uFF0C\u6BD4\u5982\u4E0A\u9762\u8FD9\u4E2A\u65F6\u95F4\u7EBF\u6240\u5C55\u793A\u7684\u662F\u4ECE360\u6BEB\u79D2\u5230480\u6BEB\u79D2\uFF0C\u8FD9\u6BB5\u65F6\u95F4\u5C31\u662F\u6211\u4EEC\u6240\u5B9A\u4F4D\u5230\u7684\u65F6\u95F4\u8282\u70B9\uFF0C\u4E0B\u9762\u6240\u5C55\u793A\u7684Network\u3001Main\u7B49\u90FD\u662F\u8BE5\u65F6\u95F4\u8282\u70B9\u5185\u7684\u8BE6\u7EC6\u6570\u636E\u3002</p><p>\u5982\u679C\u4F60\u60F3\u8981\u67E5\u770B\u4E8B\u4EF6\u8303\u56F4\u66F4\u5E7F\u7684\u6027\u80FD\u6307\u6807\uFF0C\u4F60\u53EA\u9700\u8981\u5C06\u9F20\u6807\u653E\u5230\u65F6\u95F4\u7EBF\u4E0A\uFF0C\u6EDA\u52A8\u9F20\u6807\u6EDA\u8F6E\u5C31\u53EF\u4EE5\u5C31\u884C\u7F29\u653E\u4E86\u3002\u5982\u679C\u653E\u5927\u4E4B\u540E\uFF0C\u8981\u67E5\u770B\u7684\u5185\u5BB9\u5982\u679C\u8D85\u51FA\u4E86\u5C4F\u5E55\uFF0C\u90A3\u4E48\u4F60\u53EF\u4EE5\u70B9\u51FB\u9F20\u6807\u5DE6\u952E\u6765\u62D6\u52A8\u65F6\u95F4\u7EBF\uFF0C\u76F4\u5230\u627E\u5230\u9700\u8981\u67E5\u770B\u7684\u5185\u5BB9\uFF0C\u4F60\u4E5F\u53EF\u4EE5\u901A\u8FC7\u952E\u76D8\u4E0A\u7684\u201CWASD\u201D\u56DB\u4E2A\u952E\u6765\u8FDB\u884C\u7F29\u653E\u548C\u4F4D\u7F6E\u7684\u79FB\u52A8\u3002</p><h4 id="_3-\u89E3\u8BFB\u6027\u80FD\u9762\u677F\u7684\u5404\u9879\u6307\u6807" tabindex="-1">3. \u89E3\u8BFB\u6027\u80FD\u9762\u677F\u7684\u5404\u9879\u6307\u6807 <a class="header-anchor" href="#_3-\u89E3\u8BFB\u6027\u80FD\u9762\u677F\u7684\u5404\u9879\u6307\u6807" aria-hidden="true">#</a></h4><p>\u597D\u4E86\uFF0C\u73B0\u5728\u6211\u4EEC\u4E86\u89E3\u6027\u80FD\u9762\u677F\uFF0C\u5B83\u4E3B\u8981\u7528\u6765\u5C55\u73B0<strong>\u7279\u5B9A\u65F6\u95F4\u6BB5\u5185\u7684\u591A\u79CD\u6027\u80FD\u6307\u6807\u6570\u636E</strong>\u3002\u90A3\u4E48\u8981\u5206\u6790\u8FD9\u4E9B\u6307\u6807\u6570\u636E\uFF0C\u6211\u4EEC\u5C31\u8981\u660E\u767D\u8FD9\u4E9B\u6307\u6807\u6570\u636E\u7684\u542B\u4E49\uFF0C\u4E0D\u8FC7\u8981\u5F04\u660E\u767D\u5B83\u4EEC\u5374\u5E76\u975E\u6613\u4E8B\uFF0C\u56E0\u4E3A\u8981\u5F88\u597D\u5730\u7406\u89E3\u5B83\u4EEC\uFF0C<strong>\u4F60\u9700\u8981\u638C\u63E1\u6E32\u67D3\u6D41\u6C34\u7EBF\u3001\u6D4F\u89C8\u5668\u8FDB\u7A0B\u67B6\u6784\u3001\u5BFC\u822A\u6D41\u7A0B\u7B49\u77E5\u8BC6\u70B9\u3002</strong></p><p>\u56E0\u6B64\u5728\u4ECB\u7ECD\u6027\u80FD\u6307\u6807\u4E4B\u524D\uFF0C\u6211\u4EEC\u8FD8\u9700\u8981\u5C94\u5F00\u4E00\u4E0B\uFF0C\u56DE\u987E\u4E0B\u8FD9\u4E9B\u524D\u7F6E\u7684\u77E5\u8BC6\u70B9\u3002</p><p>\u56E0\u4E3A\u6D4F\u89C8\u5668\u7684\u6E32\u67D3\u673A\u5236\u8FC7\u4E8E\u590D\u6742\uFF0C\u6240\u4EE5\u6E32\u67D3\u6A21\u5757\u5728\u6267\u884C\u6E32\u67D3\u7684\u8FC7\u7A0B\u4E2D\u4F1A\u88AB\u5212\u5206\u4E3A\u5F88\u591A\u5B50\u9636\u6BB5\uFF0C\u8F93\u5165\u7684HTML\u6570\u636E\u7ECF\u8FC7\u8FD9\u4E9B\u5B50\u9636\u6BB5\uFF0C\u6700\u540E\u8F93\u51FA\u5C4F\u5E55\u4E0A\u7684\u50CF\u7D20\uFF0C\u6211\u4EEC\u628A\u8FD9\u6837\u7684\u4E00\u4E2A\u5904\u7406\u6D41\u7A0B\u53EB\u505A<strong>\u6E32\u67D3\u6D41\u6C34\u7EBF</strong>\u3002\u4E00\u6761\u5B8C\u6574\u7684\u6E32\u67D3\u6D41\u6C34\u7EBF\u5305\u62EC\u4E86\u89E3\u6790HTML\u6587\u4EF6\u751F\u6210DOM\u3001\u89E3\u6790CSS\u751F\u6210CSSOM\u3001\u6267\u884CJavaScript\u3001\u6837\u5F0F\u8BA1\u7B97\u3001\u6784\u9020\u5E03\u5C40\u6811\u3001\u51C6\u5907\u7ED8\u5236\u5217\u8868\u3001\u5149\u6805\u5316\u3001\u5408\u6210\u3001\u663E\u793A\u7B49\u4E00\u7CFB\u5217\u64CD\u4F5C\u3002</p><p>\u6E32\u67D3\u6D41\u6C34\u7EBF\u4E3B\u8981\u662F\u5728\u6E32\u67D3\u8FDB\u7A0B\u4E2D\u6267\u884C\u7684\uFF0C\u5728\u6267\u884C\u6E32\u67D3\u6D41\u6C34\u7EBF\u7684\u8FC7\u7A0B\u4E2D\uFF0C\u6E32\u67D3\u8FDB\u7A0B\u53C8\u9700\u8981\u7F51\u7EDC\u8FDB\u7A0B\u3001\u6D4F\u89C8\u5668\u8FDB\u7A0B\u3001GPU\u7B49\u8FDB\u7A0B\u914D\u5408\uFF0C\u624D\u80FD\u5B8C\u6210\u5982\u6B64\u590D\u6742\u7684\u4EFB\u52A1\u3002\u53E6\u5916\u5728\u6E32\u67D3\u8FDB\u7A0B\u5185\u90E8\uFF0C\u53C8\u6709\u5F88\u591A\u7EBF\u7A0B\u6765\u76F8\u4E92\u914D\u5408\u3002\u5177\u4F53\u7684\u5DE5\u4F5C\u65B9\u5F0F\u4F60\u53EF\u4EE5\u53C2\u8003\u4E0B\u56FE\uFF1A</p><p><img src="https://static001.geekbang.org/resource/image/a4/09/a40850fbdfbfa4f95e1416b86bb24a09.png" alt=""></p><p>\u6E32\u67D3\u6D41\u6C34\u7EBF</p><p>\u5173\u4E8E\u6E32\u67D3\u6D41\u6C34\u7EBF\u548C\u6D4F\u89C8\u5668\u8FDB\u7A0B\u67B6\u6784\u7684\u8BE6\u7EC6\u5185\u5BB9\u6211\u5728\u524D\u9762\u7684\u7AE0\u8282\u4E2D\u4E5F\u505A\u4E86\u5F88\u591A\u4ECB\u7ECD\uFF0C\u7279\u522B\u662F\u300A<a href="https://time.geekbang.org/column/article/118205" target="_blank" rel="noreferrer">05 | \u6E32\u67D3\u6D41\u7A0B\uFF08\u4E0A\uFF09\uFF1AHTML\u3001CSS\u548CJavaScript\uFF0C\u662F\u5982\u4F55\u53D8\u6210\u9875\u9762\u7684\uFF1F</a>\u300B\u548C\u300A<a href="https://time.geekbang.org/column/article/118826" target="_blank" rel="noreferrer">06\uFF5C\u6E32\u67D3\u6D41\u7A0B\uFF08\u4E0B\uFF09\uFF1AHTML\u3001CSS\u548CJavaScript\uFF0C\u662F\u5982\u4F55\u53D8\u6210\u9875\u9762\u7684\uFF1F</a>\u300B\u8FD9\u4E24\u8282\uFF0C\u4F60\u53EF\u4EE5\u53BB\u56DE\u987E\u4E0B\u76F8\u5173\u7AE0\u8282\u7684\u8BFE\u7A0B\u5185\u5BB9\u3002</p><p>\u597D\u4E86\uFF0C\u6211\u4EEC\u7B80\u8981\u56DE\u987E\u4E86\u6E32\u67D3\u6D41\u6C34\u7EBF\u548C\u6D4F\u89C8\u5668\u7684\u8FDB\u7A0B\u67B6\u6784\uFF0C\u90A3\u4E48\u73B0\u5728\u56DE\u5F52\u6B63\u9898\uFF0C\u6765\u5206\u6790\u4E0B\u6027\u80FD\u9762\u677F\u5404\u4E2A\u6307\u6807\u9879\u7684\u5177\u4F53\u542B\u4E49\u3002\u4F60\u53EF\u4EE5\u53C2\u8003\u4E0B\u56FE\uFF1A</p><p><img src="https://static001.geekbang.org/resource/image/8b/3f/8bb592424abcef144aea6cd663d3593f.png" alt="\u56FE\u7247: https://uploader.shimo.im/f/hJhJWqCnFLg92XnR.png"></p><p>\u6027\u80FD\u9762\u677F</p><p>\u89C2\u770B\u4E0A\u56FE\u7684\u5DE6\u8FB9\uFF0C\u6211\u4EEC\u53EF\u4EE5\u770B\u5230\u5B83\u662F\u7531\u5F88\u591A\u6027\u80FD\u6307\u6807\u9879\u7EC4\u6210\u7684\uFF0C\u6BD4\u5982Network\u3001Frames\u3001Main\u7B49\uFF0C\u4E0B\u9762\u6211\u4EEC\u5C31\u6765\u4E00\u4E00\u5206\u6790\u8FD9\u4E9B\u6027\u80FD\u6307\u6807\u9879\u7684\u542B\u4E49\u3002</p><p>\u6211\u4EEC\u5148\u770B\u6700\u4E3A\u91CD\u8981\u7684<strong>Main\u6307\u6807</strong>\uFF0C\u5B83\u8BB0\u5F55\u4E86\u6E32\u67D3\u8FDB\u7A0B\u7684\u4E3B\u7EBF\u7A0B\u7684\u4EFB\u52A1\u6267\u884C\u8BB0\u5F55\uFF0C\u5728Perofrmace\u5F55\u5236\u671F\u95F4\uFF0C\u5728\u6E32\u67D3\u4E3B\u7EBF\u7A0B\u4E0A\u6267\u884C\u7684\u6240\u6709\u8BB0\u5F55\u90FD\u53EF\u4EE5\u901A\u8FC7Main\u6307\u6807\u6765\u67E5\u770B\uFF0C\u4F60\u53EF\u4EE5\u901A\u8FC7\u70B9\u51FBMain\u6765\u5C55\u5F00\u4E3B\u8FDB\u7A0B\u7684\u4EFB\u52A1\u6267\u884C\u8BB0\u5F55\uFF0C\u5177\u4F53\u4F60\u53EF\u4EE5\u89C2\u5BDF\u4E0B\u56FE\uFF1A</p><p><img src="https://static001.geekbang.org/resource/image/b4/03/b488c30b769f5289cd165c6844ebe803.png" alt=""></p><p>Main\u6307\u6807</p><p>\u89C2\u5BDF\u4E0A\u56FE\uFF0C\u4E00\u6BB5\u6BB5\u6A2A\u6761\u4EE3\u8868\u6267\u884C\u4E00\u4E2A\u4E2A\u4EFB\u52A1\uFF0C\u957F\u5EA6\u8D8A\u957F\uFF0C\u82B1\u8D39\u7684\u65F6\u95F4\u8D8A\u591A\uFF1B\u7AD6\u5411\u4EE3\u8868\u8BE5\u4EFB\u52A1\u7684\u6267\u884C\u8BB0\u5F55\u3002\u901A\u8FC7\u524D\u9762\u7AE0\u8282\u7684\u5B66\u4E60\uFF0C\u6211\u4EEC\u77E5\u9053\u4E3B\u7EBF\u7A0B\u4E0A\u8DD1\u4E86\u7279\u522B\u591A\u7684\u4EFB\u52A1\uFF0C\u8BF8\u5982\u6E32\u67D3\u6D41\u6C34\u7EBF\u7684\u5927\u90E8\u5206\u6D41\u7A0B\uFF0CJavaScript\u6267\u884C\u3001V8\u7684\u5783\u573E\u56DE\u6536\u3001\u5B9A\u65F6\u5668\u8BBE\u7F6E\u7684\u56DE\u8C03\u4EFB\u52A1\u7B49\u7B49\uFF0C\u56E0\u6B64Main\u6307\u6807\u7684\u5185\u5BB9\u975E\u5E38\u591A\uFF0C\u800C\u4E14\u975E\u5E38\u91CD\u8981\uFF0C\u6240\u4EE5\u6211\u4EEC\u5728\u4F7F\u7528Perofrmance\u7684\u65F6\u5019\uFF0C\u5927\u90E8\u5206\u65F6\u95F4\u90FD\u662F\u5728\u5206\u6790Main\u6307\u6807\u3002Main\u6307\u6807\u7684\u5185\u5BB9\u7279\u522B\u591A\uFF0C\u6211\u4F1A\u5728\u4E0B\u4E00\u8282\u5BF9\u5B83\u505A\u8BE6\u7EC6\u5206\u6790\u3002</p><p>\u901A\u8FC7\u6E32\u67D3\u6D41\u6C34\u7EBF\uFF0C\u6211\u4EEC\u77E5\u9053\u4E86\u6E32\u67D3\u4E3B\u7EBF\u7A0B\u5728\u751F\u6210\u5C42\u6811(LayerTree)\u4E4B\u540E\uFF0C\u7136\u540E\u6839\u636E\u5C42\u6811\u751F\u6210\u6BCF\u4E00\u5C42\u7684\u7ED8\u5236\u5217\u8868\uFF0C\u6211\u4EEC\u628A\u8FD9\u4E2A\u8FC7\u7A0B\u79F0\u4E3A<strong>\u7ED8\u5236(Paint)</strong>\u3002\u5728\u7ED8\u5236\u9636\u6BB5\u7ED3\u675F\u4E4B\u540E\uFF0C\u6E32\u67D3\u4E3B\u7EBF\u7A0B\u4F1A\u5C06\u8FD9\u4E9B\u7ED8\u5217\u8868\u5236<strong>\u63D0\u4EA4(commit)<strong>\u7ED9\u5408\u6210\u7EBF\u7A0B\uFF0C\u5E76\u7531\u5408\u6210\u7EBF\u7A0B\u5408\u6210\u51FA\u6765\u6F02\u4EAE\u7684\u9875\u9762\u3002\u56E0\u6B64\uFF0C\u76D1\u63A7\u5408\u6210\u7EBF\u7A0B\u7684\u4EFB\u52A1\u6267\u884C\u8BB0\u5F55\u4E5F\u76F8\u5BF9\u6BD4\u8F83\u91CD\u8981\uFF0C\u6240\u4EE5Chrome\u53C8\u5728\u6027\u80FD\u9762\u677F\u4E2D\u5F15\u5165\u4E86</strong>Compositor\u6307\u6807</strong>\uFF0C\u4E5F\u5C31\u662F\u5408\u6210\u7EBF\u7A0B\u7684\u4EFB\u52A1\u6267\u884C\u8BB0\u5F55\u3002</p><p>\u5728\u5408\u6210\u7EBF\u7A0B\u6267\u884C\u4EFB\u52A1\u7684\u8FC7\u7A0B\u4E2D\uFF0C\u8FD8\u9700\u8981GPU\u8FDB\u7A0B\u7684\u914D\u5408\u6765\u751F\u6210\u4F4D\u56FE\uFF0C\u6211\u4EEC\u628A\u8FD9\u4E2AGPU\u751F\u6210\u4F4D\u56FE\u7684\u8FC7\u7A0B\u79F0\u4E3A<strong>\u5149\u6805\u5316</strong>\u3002\u5982\u679C\u5408\u6210\u7EBF\u7A0B\u76F4\u63A5\u548CGPU\u8FDB\u7A0B\u8FDB\u884C\u901A\u4FE1\uFF0C\u90A3\u4E48\u52BF\u5FC5\u4F1A\u963B\u585E\u540E\u9762\u7684\u5408\u6210\u4EFB\u52A1\uFF0C\u56E0\u6B64\u5408\u6210\u7EBF\u7A0B\u53C8\u7EF4\u62A4\u4E86\u4E00\u4E2A<strong>\u5149\u6805\u5316\u7EBF\u7A0B\u6C60(Raster)</strong>\uFF0C\u7528\u6765\u8BA9GPU\u6267\u884C\u5149\u6805\u5316\u7684\u4EFB\u52A1\u3002\u56E0\u4E3A\u5149\u6805\u5316\u7EBF\u7A0B\u6C60\u548CGPU\u8FDB\u7A0B\u4E2D\u7684\u4EFB\u52A1\u6267\u884C\u4E5F\u4F1A\u5F71\u54CD\u5230\u9875\u9762\u7684\u6027\u80FD\uFF0C\u6240\u4EE5\u6027\u80FD\u9762\u677F\u4E5F\u6DFB\u52A0\u4E86\u8FD9\u4E24\u4E2A\u6307\u6807\uFF0C\u5206\u522B\u662F<strong>Raster\u6307\u6807</strong>\u548C<strong>GPU\u6307\u6807</strong>\u3002\u56E0\u4E3ARaster\u662F\u7EBF\u7A0B\u6C60\uFF0C\u6240\u4EE5\u5982\u679C\u4F60\u70B9\u5F00Raster\u9879\uFF0C\u53EF\u4EE5\u770B\u5230\u5B83\u7EF4\u62A4\u4E86\u591A\u4E2A\u7EBF\u7A0B\u3002</p><p>\u6E32\u67D3\u8FDB\u7A0B\u4E2D\u9664\u4E86\u6709\u4E3B\u7EBF\u7A0B\u3001\u5408\u6210\u7EBF\u7A0B\u3001\u5149\u6805\u5316\u7EBF\u7A0B\u6C60\u4E4B\u5916\uFF0C\u8FD8\u7EF4\u62A4\u4E86\u4E00\u4E2AIO\u7EBF\u7A0B\uFF0C\u5177\u4F53\u7EC6\u8282\u4F60\u53EF\u4EE5\u53C2\u8003\u300A<a href="https://time.geekbang.org/column/article/132931" target="_blank" rel="noreferrer">15 | \u6D88\u606F\u961F\u5217\u548C\u4E8B\u4EF6\u5FAA\u73AF\uFF1A\u9875\u9762\u662F\u600E\u4E48\u201C\u6D3B\u201D\u8D77\u6765\u7684\uFF1F</a>\u300B\u8FD9\u7BC7\u6587\u7AE0\u3002\u8BE5IO\u7EBF\u7A0B\u4E3B\u8981\u7528\u6765\u63A5\u6536\u7528\u6237\u8F93\u5165\u4E8B\u4EF6\u3001\u7F51\u7EDC\u4E8B\u4EF6\u3001\u8BBE\u5907\u76F8\u5173\u7B49\u4E8B\u4EF6\uFF0C\u5982\u679C\u4E8B\u4EF6\u9700\u8981\u6E32\u67D3\u4E3B\u7EBF\u7A0B\u6765\u5904\u7406\uFF0C\u90A3\u4E48IO\u7EBF\u7A0B\u8FD8\u4F1A\u5C06\u8FD9\u4E9B\u4E8B\u4EF6\u8F6C\u53D1\u7ED9\u6E32\u67D3\u4E3B\u7EBF\u7A0B\u3002\u5728\u6027\u80FD\u9762\u677F\u4E0A\uFF0C<strong>Chrome_ChildIOThread\u6307\u6807</strong>\u5BF9\u5E94\u7684\u5C31\u662FIO\u7EBF\u7A0B\u7684\u4EFB\u52A1\u8BB0\u5F55\u3002</p><p>\u597D\u4E86\uFF0C\u4EE5\u4E0A\u4ECB\u7ECD\u7684\u90FD\u662F\u6E32\u67D3\u8FDB\u7A0B\u548CGPU\u8FDB\u7A0B\u7684\u4EFB\u52A1\u8BB0\u5F55\uFF0C\u9664\u6B64\u4E4B\u5916\uFF0C\u6027\u80FD\u9762\u677F\u8FD8\u6DFB\u52A0\u4E86\u5176\u4ED6\u4E00\u4E9B\u6BD4\u8F83\u91CD\u8981\u7684\u6027\u80FD\u6307\u6807\u3002</p><p>\u7B2C\u4E00\u4E2A\u662F<strong>Network\u6307\u6807</strong>\uFF0C\u7F51\u7EDC\u8BB0\u5F55\u5C55\u793A\u4E86\u9875\u9762\u4E2D\u7684\u6BCF\u4E2A\u7F51\u7EDC\u8BF7\u6C42\u6240\u6D88\u8017\u7684\u65F6\u957F\uFF0C\u5E76\u4EE5\u7011\u5E03\u6D41\u7684\u5F62\u5F0F\u5C55\u73B0\u3002\u8FD9\u5757\u5185\u5BB9\u548C\u7F51\u7EDC\u9762\u677F\u7684\u7011\u5E03\u6D41\u7C7B\u4F3C\uFF0C\u4E4B\u6240\u4EE5\u653E\u5728\u6027\u80FD\u9762\u677F\u4E2D\u662F\u4E3A\u4E86\u65B9\u4FBF\u6211\u4EEC\u548C\u5176\u4ED6\u6307\u6807\u5BF9\u7167\u7740\u5206\u6790\u3002</p><p>\u7B2C\u4E8C\u4E2A\u662F<strong>Timings\u6307\u6807</strong>\uFF0C\u7528\u6765\u8BB0\u5F55\u4E00\u4E9B\u5173\u952E\u7684\u65F6\u95F4\u8282\u70B9\u5728\u4F55\u65F6\u4EA7\u751F\u7684\u6570\u636E\u4FE1\u606F\uFF0C\u5173\u4E8E\u8FD9\u4E9B\u5173\u952E\u65F6\u95F4\u70B9\u7684\u4FE1\u606F\u6211\u4EEC\u5728\u4E0A\u4E00\u8282\u4E5F\u4ECB\u7ECD\u8FC7\u4E86\uFF0C\u8BF8\u5982FP\u3001FCP\u3001LCP\u7B49\u3002</p><p>\u7B2C\u4E09\u4E2A\u662F<strong>Frames\u6307\u6807</strong>\uFF0C\u4E5F\u5C31\u662F\u6D4F\u89C8\u5668\u751F\u6210\u6BCF\u5E27\u7684\u8BB0\u5F55\uFF0C\u6211\u4EEC\u77E5\u9053\u9875\u9762\u6240\u5C55\u73B0\u51FA\u6765\u7684\u753B\u9762\u90FD\u662F\u7531\u6E32\u67D3\u8FDB\u7A0B\u4E00\u5E27\u4E00\u5E27\u6E32\u67D3\u51FA\u6765\u7684\uFF0C\u5E27\u8BB0\u5F55\u5C31\u662F\u7528\u6765\u8BB0\u5F55\u6E32\u67D3\u8FDB\u7A0B\u751F\u6210\u6240\u6709\u5E27\u4FE1\u606F\uFF0C\u5305\u62EC\u4E86\u6E32\u67D3\u51FA\u6BCF\u5E27\u7684\u65F6\u957F\u3001\u6BCF\u5E27\u7684\u56FE\u5C42\u6784\u9020\u7B49\u4FE1\u606F\uFF0C\u4F60\u53EF\u4EE5\u70B9\u51FB\u5BF9\u5E94\u7684\u5E27\uFF0C\u7136\u540E\u5728\u8BE6\u7EC6\u4FE1\u606F\u9762\u677F\u91CC\u9762\u67E5\u770B\u5177\u4F53\u4FE1\u606F\u3002</p><p>\u7B2C\u56DB\u4E2A\u662F<strong>Interactions\u6307\u6807</strong>\uFF0C\u7528\u6765\u8BB0\u5F55\u7528\u6237\u4EA4\u4E92\u64CD\u4F5C\uFF0C\u6BD4\u5982\u70B9\u51FB\u9F20\u6807\u3001\u8F93\u5165\u6587\u5B57\u7B49\u4EA4\u4E92\u4FE1\u606F\u3002</p><h4 id="_4-\u8BE6\u60C5\u9762\u677F" tabindex="-1">4. \u8BE6\u60C5\u9762\u677F <a class="header-anchor" href="#_4-\u8BE6\u60C5\u9762\u677F" aria-hidden="true">#</a></h4><p>\u901A\u8FC7\u6027\u80FD\u9762\u677F\u7684\u5206\u6790\uFF0C\u6211\u4EEC\u77E5\u9053\u4E86\u6027\u80FD\u9762\u677F\u8BB0\u5F55\u4E86\u591A\u79CD\u6307\u6807\u7684\u6570\u636E\u4FE1\u606F\uFF0C\u5E76\u4E14\u4EE5\u56FE\u5F62\u7684\u5F62\u5F0F\u5C55\u73B0\u5728\u6027\u80FD\u9762\u677F\u4E0A\u3002</p><p>\u5177\u4F53\u5730\u8BB2\uFF0C\u6BD4\u5982\u4E3B\u7EBF\u7A0B\u4E0A\u6267\u884C\u4E86\u89E3\u6790HTML(ParserHTML)\u7684\u4EFB\u52A1\uFF0C\u5BF9\u5E94\u4E8E\u6027\u80FD\u9762\u677F\u5C31\u662F\u4E00\u4E2A\u957F\u6761\u548C\u591A\u4E2A\u7AD6\u6761\u7EC4\u6210\u56FE\u5F62\u3002\u901A\u8FC7\u4E0A\u9762\u7684\u56FE\u5F62\u6211\u4EEC\u53EA\u80FD\u5F97\u5230\u4E00\u4E2A\u5927\u81F4\u7684\u4FE1\u606F\uFF0C\u5982\u679C\u60F3\u8981\u67E5\u770B\u8FD9\u4E9B\u8BB0\u5F55\u7684\u8BE6\u7EC6\u4FE1\u606F\uFF0C\u5C31\u9700\u8981\u5F15\u5165<strong>\u8BE6\u60C5\u9762\u677F</strong>\u4E86\u3002</p><p>\u4F60\u53EF\u4EE5\u901A\u8FC7\u5728\u6027\u80FD\u9762\u677F\u4E2D\u9009\u4E2D\u6027\u80FD\u6307\u6807\u4E2D\u7684\u4EFB\u4F55\u5386\u53F2\u6570\u636E\uFF0C\u7136\u540E\u9009\u4E2D\u8BB0\u5F55\u7684\u7EC6\u8282\u4FE1\u606F\u5C31\u4F1A\u5C55\u73B0\u5728\u8BE6\u60C5\u9762\u677F\u4E2D\u4E86\u3002\u6BD4\u5982\u6211\u70B9\u51FB\u4E86Main\u6307\u6807\u4E2D\u7684ParserHTML\u8FD9\u4E2A\u8FC7\u7A0B\uFF0C\u4E0B\u56FE\u5C31\u662F\u8BE6\u60C5\u9762\u677F\u5C55\u73B0\u8BE5\u8FC7\u7A0B\u7684\u8BE6\u7EC6\u4FE1\u606F\u3002</p><p><img src="https://static001.geekbang.org/resource/image/61/94/6148b6e934c8cf21319b9cc5bb3c5094.png" alt=""></p><p>\u8BE6\u7EC6\u4FE1\u606F</p><p>\u7531\u4E8E\u8BE6\u60C5\u9762\u677F\u6240\u6D89\u53CA\u7684\u5185\u5BB9\u5F88\u591A\uFF0C\u800C\u4E14\u6BCF\u79CD\u6307\u6807\u7684\u8BE6\u7EC6\u5185\u5BB9\u90FD\u6709\u6240\u4E0D\u540C\uFF0C\u6240\u4EE5\u672C\u8282\u6211\u5C31\u4E0D\u5C55\u5F00\u6765\u8BB2\u4E86\u3002\u53E6\u5916\u4F60\u53EF\u4EE5\u53BBGoogle\u7684\u5B98\u65B9\u7F51\u7AD9\u67E5\u770BPerformance\u7684\u4E00\u4E9B<a href="https://developers.google.com/web/tools/chrome-devtools/evaluate-performance/timeline-tool?hl=zh-CN" target="_blank" rel="noreferrer">\u57FA\u7840\u4F7F\u7528\u4FE1\u606F</a>\u3002</p><h2 id="\u603B\u7ED3" tabindex="-1">\u603B\u7ED3 <a class="header-anchor" href="#\u603B\u7ED3" aria-hidden="true">#</a></h2><p>\u597D\u4E86\uFF0C\u672C\u8282\u5185\u5BB9\u5C31\u4ECB\u7ECD\u5230\u8FD9\u91CC\uFF0C\u4E0B\u9762\u6211\u6765\u603B\u7ED3\u4E0B\u672C\u6587\u7684\u4E3B\u8981\u5185\u5BB9\uFF1A</p><p>\u672C\u8282\u6211\u4EEC\u9996\u5148\u4ECB\u7ECD\u4E86\u5982\u4F55\u53BB\u914D\u7F6EPerformance\u5E76\u751F\u6210\u62A5\u544A\u9875\uFF0C\u7136\u540E\u6211\u4EEC\u5C06\u7126\u70B9\u653E\u5728\u4E86\u5982\u4F55\u89E3\u8BFB\u62A5\u544A\u9875\u4E0A\u3002</p><p>\u4E4B\u540E\u6211\u4EEC\u4ECB\u7ECD\u4E86\u62A5\u544A\u9875\u9762\u4E3B\u8981\u5206\u4E3A\u4E09\u4E2A\u90E8\u5206\uFF0C\u6982\u89C8\u9762\u677F\u3001\u6027\u80FD\u9762\u677F\u548C\u8BE6\u60C5\u9762\u677F\u3002</p><p>\u6211\u4EEC\u53EF\u4EE5\u901A\u8FC7\u6982\u89C8\u9762\u677F\u6765\u5B9A\u4F4D\u95EE\u9898\u7684\u65F6\u95F4\u8282\u70B9\uFF0C\u7136\u540E\u518D\u4F7F\u7528\u6027\u80FD\u9762\u677F\u5206\u6790\u8BE5\u65F6\u95F4\u8282\u70B9\u5185\u7684\u6027\u80FD\u6570\u636E\u3002\u4E0D\u8FC7\u5728\u5206\u6790\u6570\u636E\u65F6\uFF0C\u6211\u4EEC\u9700\u8981\u5F04\u660E\u767D\u6027\u80FD\u9762\u677F\u5185\u5404\u9879\u6570\u636E\u6307\u6807\u7684\u542B\u4E49\uFF0C\u8981\u4E86\u89E3\u8FD9\u4E9B\uFF0C\u9700\u8981\u4E86\u89E3\u6D4F\u89C8\u5668\u6E32\u67D3\u6D41\u6C34\u7EBF\u3001\u6D4F\u89C8\u5668\u7684\u8FDB\u7A0B\u67B6\u6784\u7B49\u77E5\u8BC6\u70B9\uFF0C\u56E0\u6B64\u7ED3\u5408\u8FD9\u4E9B\u77E5\u8BC6\u70B9\uFF0C\u6211\u4EEC\u63A5\u4E0B\u6765\u5206\u6790\u4E86\u6027\u80FD\u9762\u677F\u7684\u5404\u9879\u6307\u6807\u7684\u542B\u4E49\u3002</p><p>\u5176\u4E2D\u6700\u4E3A\u91CD\u8981\u7684\u662FMain\u6307\u6807\uFF0C\u5B83\u8BB0\u5F55\u4E86\u6E32\u67D3\u4E3B\u7EBF\u7A0B\u4E0A\u7684\u4EFB\u52A1\u6267\u884C\u60C5\u51B5\uFF0C\u4E0D\u8FC7\u8FD9\u5757\u7EC6\u8282\u5185\u5BB9\u4F1A\u975E\u5E38\u591A\uFF0C\u6240\u4EE5\u6211\u4EEC\u4F1A\u5728\u4E0B\u4E00\u8282\u6765\u4ECB\u7ECD\u3002</p><p>\u6700\u540E\u6211\u4EEC\u8FD8\u4ECB\u7ECD\u4E86\u6BCF\u4E2A\u6307\u6807\u9879\u7684\u5185\u5BB9\u90FD\u6709\u8BE6\u7EC6\u6570\u636E\uFF0C\u8FD9\u4E9B\u8BE6\u7EC6\u6570\u636E\u662F\u901A\u8FC7\u8BE6\u60C5\u9762\u677F\u6765\u5C55\u73B0\uFF0C\u4F60\u53EA\u9700\u8981\u901A\u8FC7\u6027\u80FD\u9762\u677F\u70B9\u51FB\u76F8\u5E94\u7684\u6570\u636E\uFF0C\u5C31\u80FD\u901A\u8FC7\u8BE6\u60C5\u9762\u677F\u6765\u67E5\u770B\u8BE6\u7EC6\u6570\u636E\u4E86\u3002\u4E0D\u8FC7\u8BE6\u60C5\u9762\u677F\u6240\u6D89\u53CA\u7684\u6570\u636E\u4E5F\u662F\u975E\u5E38\u591A\u7684\uFF0C\u6240\u4EE5\u672C\u6587\u4E5F\u5C31\u6CA1\u5BF9\u8BE6\u60C5\u9762\u677F\u505A\u8FC7\u6DF1\u7684\u4ECB\u7ECD\u4E86\u3002</p><p>\u6211\u628APerformance\u6BD4\u55BB\u6210\u4E00\u5F20\u7F51\uFF0C\u5B83\u80FD\u628A\u6211\u4EEC\u5728\u524D\u9762\u7AE0\u8282\u4E2D\u5F88\u591A\u77E5\u8BC6\u70B9\u90FD\u7F51\u7F57\u8D77\u6765\uFF0C\u5E76\u5E94\u7528\u5230\u5B9E\u8DF5\u4E2D\u3002</p><h2 id="\u601D\u8003\u9898" tabindex="-1">\u601D\u8003\u9898 <a class="header-anchor" href="#\u601D\u8003\u9898" aria-hidden="true">#</a></h2><p>\u90A3\u4E48\u4ECA\u5929\u7559\u7ED9\u4F60\u7684\u4EFB\u52A1\u662F\uFF0C\u591A\u627E\u51E0\u4E2A\u7AD9\u70B9\uFF0C\u4F7F\u7528Performance\u6765\u5F55\u5236\u52A0\u8F7D\u8FC7\u7A0B\u548C\u4EA4\u4E92\u8FC7\u7A0B\uFF0C\u5E76\u719F\u6089\u62A5\u544A\u9875\u9762\u4E2D\u7684\u5404\u9879\u6027\u80FD\u6307\u6807\uFF0C\u5982\u679C\u6709\u9047\u5230\u4E0D\u660E\u767D\u7684\u95EE\u9898\uFF0C\u6B22\u8FCE\u5728\u7559\u8A00\u533A\u7559\u8A00\u4E0E\u6211\u4EA4\u6D41\u3002</p><p>\u611F\u8C22\u9605\u8BFB\uFF0C\u5982\u679C\u4F60\u89C9\u5F97\u8FD9\u7BC7\u6587\u7AE0\u5BF9\u4F60\u6709\u5E2E\u52A9\u7684\u8BDD\uFF0C\u4E5F\u6B22\u8FCE\u628A\u5B83\u5206\u4EAB\u7ED9\u66F4\u591A\u7684\u670B\u53CB\u3002</p>',78),p=[o];function s(i,c,g,l,h,d){return a(),r("div",null,p)}const P=e(n,[["render",s]]);export{f as __pageData,P as default};
